import React from "react";

import { Grid, Stack } from "@mui/material";
import IntroduceText from "../../components/IntroduceText";
import CustomBox from "../../components/CustomBox";

import stores from "../../assets/img/aboutus/photoGallery1.png";

function Store() {
  return (
    <Grid
      container
      spacing={2}
      justifyContent="center"
      alignItem="center"
      mt={30}
    >
      <Grid item xs={12} lg={12}>
        <IntroduceText firstLine="입점한" secondLine="가맹점" />
      </Grid>
      <Grid item xs={12} lg={12}>
        <Stack
          direction="row"
          justifyContent="center"
          alignItems="center"
          spacing={1}
        >
          <CustomBox>
            <img src={photoGallery1} alt="" width="100%" />
          </CustomBox>
          <CustomBox>
            <img src={photoGallery2} alt="" width="100%" />
          </CustomBox>
          <CustomBox>
            <img src={photoGallery3} alt="" width="100%" />
          </CustomBox>
          <CustomBox>
            <img src={photoGallery4} alt="" width="100%" />
          </CustomBox>
          <CustomBox>
            <img src={photoGallery5} alt="" width="100%" />
          </CustomBox>
        </Stack>
      </Grid>
    </Grid>
  );
}

export default Store;
